■生地名称:グランドダイヤシートカバー<br>
■タイプ選択して下さい:運転席/助手席<br>
■車種別<br>
1.日野グランドプロフィア　H15.12～　2人　運肘掛け有り/枕一体式<br>
2.日野レンジャープロ　H14.2～　2人　運肘掛け有り・無し/枕一体式<br>
3.三菱07スーパーグレート　H19.4～　2人　運肘掛け有り/枕一体式<br>
4.三菱新型ファイター　H17.10～　2人　運肘掛け有り・無し/枕一体式<br>
5.UDクオン初期型　H17.～　2人　運肘掛け有り/枕一体式/助手席枕分割<br>
6.UDクオン中期型　H20頃～　2人　運肘掛け有り/運助とも枕一体式<br>
7.UDクオン現行型/フレンズコンドル　H23.～　2人　運肘掛け有り/枕一体式/助手席枕分割<br>
8.いすゞギガ　H19.5～H27.10　2人　運肘掛け有り/枕一体式<br>
9.いすゞファイブスターギガ　H27.11～　2人　運肘有り/枕一体式 <br>
10.いすゞ07フォワード　H19.～　2人　運肘掛け有り・無し/枕一体式<br>
■海外生産<br>
特徴<br>
ウエスト及びヒップ部に収縮性を考慮した直線的な縫製を、背中・脇腰・大腿部に、
